import React from 'react'
import { connect } from 'react-redux'

const Index = ({ home }) => {
  return (
    <div id='home'>
    </div>
  )
}

const mapStateToProps = state => {
  return {
    home: state
  }
}

export default connect(mapStateToProps)(Index)
